&quot;Blood &amp; Guts&quot; - A History of Surgery: Spare Parts

Part 3 of 5
Wednesday, 27th August 2008
9pm to 10pm (1 hour)
BBC4


Documentary series about the brutal, bloody and dangerous history of surgery continues with a look at the development of transplant surgery, from a Nazi sympathiser to the latest miraculous life and limb saving operations.

These days transplant surgery saves thousands of lives every year and almost everything, from heart to eyes, can be replaced. But in the beginning transplants killed rather than cured, because surgeons didn&amp;#039;t understand that they were taking on one of the most efficient killing systems we know of - the human immune system.
